import React from 'react';
import { Form, Input, Button, Checkbox } from 'antd';
import { UserOutlined, LockOutlined,MailOutlined,PhoneOutlined,HomeOutlined } from '@ant-design/icons';
import {
  Link
} from "react-router-dom";
import 'antd/dist/antd.css'

const SignUpPage = () => {
  const [form] = Form.useForm()

  const styleSize = {
    paddingLeft: '47px',
    display: 'flex',
    color: 'black',
    fontSize: '30px',
    justifyContent: 'center',
    marginTop: '40px',
    marginBottom: '9px'
  }

  const tailLayout = {
    wrapperCol: {
      offset: 10,
      span: 5,
    },
  };

  const tailLayoutSignUp = {
    wrapperCol: {
      offset: 12,
      span: 5,
    },
  };

  const layout = {
    labelCol: {
      span: 10,
    },
    wrapperCol: {
      span: 5,
    },
  };

  const onFinish = (values) => {
    console.log('success', values)
  }

  const onFinishFailed = (errors) => {
    console.log('unsuccess', errors)
  }

  const submitForm = async () => {
    const payload = await form.getFieldValue()
    console.log('payload Sign Up', payload)
  }
  return (
    <>
    <span style={styleSize}>ĐĂNG KÝ</span>
      <Form
        {...layout}
        name="normal_login"
        className="login-form"
        initialValues={{
          remember: true,
        }}
        onFinish={onFinish}
        onSubmit={submitForm}
      >
        <Form.Item {...tailLayout}
          name="email"
          rules={[
            {
              required: true,
              message: 'Please input your Email!',
            },
          ]}
        >
          <Input prefix={<MailOutlined className="site-form-item-icon" />} placeholder="Email" />
        </Form.Item>

        <Form.Item {...tailLayout}
          name="password"
          rules={[
            {
              required: true,
              message: 'Please input your Password!',
            },
          ]}
        >
          <Input
            prefix={<LockOutlined className="site-form-item-icon" />}
            type="password"
            placeholder="Password"
          />
        </Form.Item>

        <Form.Item {...tailLayout}
          name="name"
          rules={[
            {
              required: true,
              message: 'Please input your Name!',
            },
          ]}
        >
          <Input prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Họ tên" />
        </Form.Item>

        <Form.Item {...tailLayout}
          name="address"
          rules={[
            {
              required: true,
              message: 'Please input your Address!',
            },
          ]}
        >
          <Input prefix={<HomeOutlined className="site-form-item-icon" />} placeholder="Địa chỉ" />
        </Form.Item>

        <Form.Item {...tailLayout}
          name="phonenum"
          rules={[
            {
              required: true,
              message: 'Please input your PhoneNumber!',
            },
          ]}
        >
          <Input prefix={<PhoneOutlined className="site-form-item-icon" />} placeholder="Số điện thoại" />
        </Form.Item>

        <Form.Item {...tailLayoutSignUp}>
          <Button type="primary" htmlType="submit" className="login-form-button" onClick={submitForm}>
            Đăng Ký
        </Button>
        </Form.Item>
      </Form>
    </>
  );
};

export default SignUpPage;
